import React from 'react';
import { Header } from './Header';
import { HomePage } from './HomePage';
/** @jsx jsx */
import { css, jsx } from '@emotion/core';
import { fontFamily, fontSize, gray2 } from './Styles';

function App() {
  return (
    <div
      css={css`
        font-family: 'Segoe UI', 'Helvetic Neue', sans-serif;
        font-size: 16px;
        color: #5c5a5a;
      `}
    >
      <Header />
      <HomePage />
    </div>
  );
}

export default App;
